&lt;p&gt;The Department of the AUTestingRecords3 designs and implements the Australian Government’s policies and programmes to protect and conserve the environment, water and heritage and promote climate action. The environmental framework is being delivered under four pillars:&lt;/p&gt;
                &lt;ul&gt;
                &lt;li&gt;Clean Water&lt;/li&gt;
                &lt;li&gt;Clean Air&lt;/li&gt;
                &lt;li&gt;Clean Land&lt;/li&gt;
                &lt;li&gt;National heritage&lt;/li&gt;
                &lt;/ul&gt;
                &lt;p&gt;Throughout Australia, environment and heritage issues are also managed by other levels of government.&lt;/p&gt;
